import React, { Component } from 'react';
import Header from './components/Header';

import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends Component {
  render() {
    return (
      <div>
        <Header />

        <div className="container">
          <form className="mt-3" id="form">
              <div className="input-group">
                  <input type="text" className="form-control" placeholder="Movie Search" aria-describedby="button-addon" />
                  <div className="input-group-append">
                      <button className="btn btn-primary btn-submit" type="submit" id="button-addon">Search</button>
                  </div>
              </div>
          </form>
        </div>
      </div>
    )
  }
}


